import React from "react";
import Header from "../../widget/Components/Header.js";
import Footer from "../../widget/Components/Footer";
import Hero from "../Hero/Hero.js";
import "../../App.css";
function Home() {
  return (
    <div className="page-container">
      <div className="content-wrap">
        <div>
          <Header />
          <Hero />
          <Footer />
        </div>
      </div>
    </div>
  );
}

export default Home;
